      '<div><div>FOR IMMEDIATE RELEASE          Contact: Sherylin Stevens, <a class="__cf_email__" data-cfemail="9eededeafbe8fbf0eddeeafbffecedf1f0fdf1eceeb0fdff" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/></div><div>CALGARY (2 November)-Yves Vernier, the Chief Information Officer of the Tearson Corporation, announced on Monday that 200 robots will soon appear in Tearson\'s grocery stores. The robots, which are all named Bailey, will be used to locate areas where boxes or bottles have fallen and broken, spilling cereal, juice, or other substances onto the floor.</div><div><br/></div><div>The robots will report the spills so that the locations can be cleaned by store employees before they become safety hazards. The robots were tested in Calgary, where Tearson\'s head office is located. During the eighteen-month pilot programme, store managers consistently gave the robots high marks. Although the robots have been used in the company\'s warehouses for several years, this will be their first time working in stores and interacting with customers. All Tearson stores should have the robots by the beginning of December.</div><div><br/></div><div>For more information, visit Tearson Corporation at www.tearsoncorporation.ca.</div><div><br/></div> <hr/></div>',
    transcript:
      '<div><p>ĐỂ ĐƯỢC BÁO CÁO NGAY LẬP TỨC.   Liên hệ: Sherylin Stevens, <a class="__cf_email__" data-cfemail="e89b9b9c8d9e8d869ba89c8d899a9b87868b879a98c68b89" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p>CALGARY (2 tháng 11) -Yves Vernier, Giám đốc Thông tin của Tearson Corporation, đã thông báo vào thứ Hai rằng 200 robot sẽ sớm xuất hiện trong các cửa hàng tạp hóa của Tearson. Các robot, tất cả đều được đặt tên là Bailey, sẽ được sử dụng để xác định các khu vực nơi hộp hoặc chai bị rơi và vỡ, làm đổ ngũ cốc, nước trái cây hoặc các chất khác xuống sàn.</p><p>Các rô bốt sẽ báo cáo sự cố tràn để nhân viên cửa hàng có thể làm sạch các vị trí trước khi chúng trở thành mối nguy hiểm về an toàn. Các robot đã được thử nghiệm tại Calgary, nơi đặt trụ sở chính của Tearson. Trong suốt chương trình thử nghiệm kéo dài mười tám tháng, các nhà quản lý cửa hàng đã liên tục cho robot điểm cao. Mặc dù các robot đã được sử dụng trong các nhà kho của công ty trong vài năm, nhưng đây sẽ là lần đầu tiên chúng làm việc trong các cửa hàng và tương tác với khách hàng. Tất cả các cửa hàng Tearson sẽ có robot vào đầu tháng 12.</p><p>Để biết thêm thông tin, hãy truy cập Tearson Corporation tại www.tearsoncorporation.ca.</p><hr/></div>',
