    detail:
      '<div><div>From: Helen Dietrich &lt;<a class="__cf_email__" data-cfemail="c7afa3aea2b3b5aea4af87aaa8b5b7afa8b4b7b2a5abaeb4afaea9a0e9a4a6" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;<br/></div><div>To: Alia Cervantes <a class="__cf_email__" data-cfemail="f89b99949199d69b9d8a8e99968c9d8bb89f978c9795999194d69b99" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</div><div>Date: 3 March</div><div>Subject: Practical Gardening</div><div>Dear Ms. Cervantes:</div><div>I am sorry to report that next month\'s issue of Practical Gardening will be our last. After 62 years of monthly issues, we at Morphos Publishing have decided that Practical Gardening will be among the periodicals that we must discontinue. We plan to redirect the resources gained through cost-cutting toward growing our book publishing and instructional video production businesses.</div><div><br/></div><div>We are grateful for your support as a longtime subscriber to Practical Gardening. For the remainder of your subscription term, we hope you will allow us to instead send you Flora Discovery, our popular publication about wild plants. However, if you would rather have the balance of your subscription account refunded to you, please contact us at (822) 555-0127.</div><div><br/></div><div>Sincerely,</div><div>Helen Dietrich</div><div>Subscription Manager, Morphos Publishing</div> <hr/></div>',
    transcript:
      '<div><p>Người gửi: Helen Dietrich &lt;<a class="__cf_email__" data-cfemail="48202c212d3c3a212b200825273a3820273b383d2a24213b2021262f662b29" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</p><p>Tới: Alia Cervantes <a class="__cf_email__" data-cfemail="4e2d2f22272f602d2b3c382f203a2b3d0e29213a21232f2722602d2f" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</p><p>Ngày: 3 tháng 3</p><p>Chủ đề: Làm vườn thực tế</p><p>Kính gửi bà Cervantes:</p><p>Tôi rất tiếc phải thông báo rằng tạp chí Làm vườn thực tế vào tháng tới sẽ là số cuối cùng của chúng tôi. Sau 62 năm phát hành hàng tháng, chúng tôi tại Nhà xuất bản Morphos đã quyết định rằng Làm vườn thực tế sẽ là một trong những ấn phẩm định kỳ mà chúng tôi phải ngừng phát hành. Chúng tôi có kế hoạch chuyển hướng các nguồn lực có được thông qua việc cắt giảm chi phí để phát triển các doanh nghiệp xuất bản sách và sản xuất video hướng dẫn của chúng tôi.</p><p>Chúng tôi rất biết ơn sự ủng hộ của bạn với tư cách là người đăng ký lâu năm cho Làm vườn thực tế. Trong thời hạn đăng ký còn lại của bạn, chúng tôi hy vọng bạn sẽ cho phép chúng tôi gửi cho bạn Flora Discovery, ấn phẩm phổ biến của chúng tôi về các loài thực vật hoang dã. Tuy nhiên, nếu bạn muốn được hoàn lại số dư trong tài khoản đăng ký của mình, vui lòng liên hệ với chúng tôi theo số (822) 555-0127.</p><p>Trân trọng,</p><p>Helen Dietrich</p><p>Quản lý đăng ký, Morphos Publishing</p><hr/></div>',
