      "<div><div><div>To: All staff<br/></div><div>From: Jan Merchant</div><div>Date: October 15</div><div>Subject: Reginald Carmen</div><div><br/></div><div>Dear Colleagues,</div><div>It is my pleasure to welcome Reginald Carmen to Edmonton Engineering Consultants, LLC. -[1]-.</div><div><br/></div><div>With his expertise in engineering and education, Dr. Carmen will be a valuable addition to our distinguished staff. -[2]-. Upon graduating from university, he spent six years designing telecommunications systems for AstroPart, Inc. He comes to us directly from the Glasse School of Engineering, where he spent the past nineteen years. While there, he served as a full-time professor for ten years, teaching advanced mathematics and various special courses in engineering. He was then appointed president of the school and served in that position for the remaining nine years of his tenure. -[3]- During that time, he led the team that redesigned the school's electrical engineering curriculum. -[4]-</div><div><br/></div><div>Dr. Carmen's first day will be next Tuesday.</div><div><br/></div><div>Jan Merchant, Director of Personnel<br/></div></div><div><br/></div> <hr/><div><br/></div><div><br/></div></div>",
    transcript:
      "<div><div>Kính gửi: Toàn thể nhân viên</div><div>Từ: Jan Merchant</div><div>Ngày: 15 tháng 10</div><div>Chủ đề: Reginald Carmen</div><div><br/></div><div>Đồng nghiệp thân mến,</div><div>Tôi rất vui được chào đón Reginald Carmen đến với Edmonton Engineering Consultants, LLC. - [1] -.</div><div><br/></div><div>Với chuyên môn của mình trong lĩnh vực kỹ thuật và giáo dục, Tiến sĩ Carmen sẽ là sự bổ sung quý giá cho đội ngũ nhân viên ưu tú của chúng ta. - [2] -. Sau khi tốt nghiệp đại học, anh ấy đã dành sáu năm thiết kế hệ thống viễn thông cho AstroPart, Inc. Trong thời gian ở đó, ông là giáo sư toàn thời gian trong mười năm, giảng dạy toán cao cấp và các khóa học đặc biệt khác nhau về kỹ thuật. Sau đó ông được bổ nhiệm làm hiệu trưởng của trường và giữ chức vụ đó trong chín năm còn lại của nhiệm kỳ. - [3] - Trong thời gian đó, ông lãnh đạo nhóm thiết kế lại chương trình giảng dạy kỹ thuật điện của trường. -[4]-</div><div><br/></div><div>Ngày đầu tiên của Tiến sĩ Carmen sẽ là thứ Ba tới.</div><div><br/></div><div>Jan Merchant, Giám đốc Nhân sự</div><hr/><div><br/></div></div>",
