    detail:
      '<div><div>Coffer Digital Management Steering Committee</div><div>Meeting Minutes</div><div>November 12</div><div><br/></div><ol><li>Re-pitch is ready to be pilot tested.</li><li>The pilot test will be carried out during the first quarter of the fiscal year, January 3-March 31.</li><li>Five existing clients will use the experimental version of Re-pitch during the pilot test. They will then take a survey to rate the software\'s effectiveness, ease of use, and affordability.</li><li>If the Re-pitch pilot is successful, a large dollar investment will be needed to design and run an extensive marketing campaign.</li><li>Our company president will explore potential funding sources for this campaign.</li></ol><div><br/></div> <hr/><p>To: <a class="__cf_email__" data-cfemail="a4d7c5c8c1d7e4c7cbc2c2c1d68ac7cbc9" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/>From: <a class="__cf_email__" data-cfemail="3a4e595b557a5f4d5f494e174e5b534a5f5314595557144e4d" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/>Date: 13 April<br/>Subject: Pilot test</p><p>Dear Coffer Digital,</p><p>I wanted to follow up after having just submitted our thoughts regarding your Re-pitch marketing software. You will find that our pilot-test feedback is overwhelmingly positive, which is why we would like to be notified immediately upon the rollout of this product. We are very eager to add Re-pitch to our permanent digital marketing efforts.</p><p>Sincerely,</p><p>Ting Cao. Director of Global Internet Marketing<br/>Ewest Clothing Ltd., Taipei</p><hr/><p>Business Briefs</p><p>Coffer Digital closed a deal yesterday with GPZ Capital. GPZ will make a significant investment in Coffer Digital, enabling the funding of a new online marketing application called Re-pitch. This sales-boosting software works by generating a pop-up window that reminds online shoppers of products they have already viewed, after they have navigated away from the product page.</p><p>GPZ\'s knowledge of data and marketing has enabled them to make successful investments in three other software development firms in the past five years. Coffer Digital\'s strong company reputation and top-notch employees easily support GPZ\'s decision to invest. "Coffer Digital has a solid plan for distributing Re-pitch, so it was an easy decision to invest with them," said Jessica Gould, spokesperson for GPZ.</p><div><br/></div><hr/></div>',
