      '<div><div>Zell Exteriors\' metal roofing products offer many advantages over traditional roofing materials.</div><div><b>Benefit 1-Weather resistance:</b> <br/>Technology that provides greater protection from hail, wind, and rain</div><div><b>Benefit 2-Wide selection:</b> <br/>Large selection of panel types, trim options, and paint colors to choose from</div><div><b>Benefit 3-Satisfaction guarantee: <br/></b>30-year warranty for added peace of mind</div><div><b>Benefit 4-Established reputation:</b> <br/>Quality roofing from a trusted company</div><div><br/></div><div>For questions about specific products or to request a quote from our sales staff, complete our online contact form. All our roofing panels are fabricated at one of our regional manufacturing facilities, precut to the necessary dimensions for your roof, and shipped to a branch near you. Our professional installers will then take it from there.</div><div><br/></div> <hr/><p>Name: Gus Keenan<br/>E-mail: <a class="__cf_email__" data-cfemail="12753c7977777c737c527367667d7765607b66773c7c7766" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/>Phone: 555-0188</p><p>Comments:</p><p>I have been looking at various roofing materials, and the wide range of paint options makes your company my top choice. My shed building is an odd shade of purple, and I want to find a color that complements it. But I have a question. I would like the new metal roof to be placed on top of the old shingle roof I have. This would save money on time, labor, and disposal. Is that something you recommend? I have spent a lot of time reading online forums for professional contractors, and there are mixed opinions about this.</p><hr/><p>To: <a class="__cf_email__" data-cfemail="e582cb8e80808b848ba58490918a8092978c9180cb8b8091" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/>From: <a class="__cf_email__" data-cfemail="e58b968d8097919fa59f808989809d9180978c8a9796cb868a88" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a><br/>Date: May 20<br/>Subject: Roofing Inquiry<br/>Attachment: @Zell Exteriors catalog</p><p>Dear Mr. Keenan,</p><p>A sales representative will contact you by phone within 48 hours, but first please look over the attached product catalog. Here are the four basic roofing types that we offer:</p><p>SLP Snap Lock Steel panels with a locking feature that enables rapid installation.</p><p>XM Panel Aluminum panels with superior corrosion resistance. Ideal for wet climates.</p><p>QR Rigid Low-cost panels that can be installed directly on top of an existing roof.</p><p>WT Panel Our most durable commercial-grade steel. Available only in white and gray.</p><p>Thank you,<br/>Nicola Shertz. Administrative Assistant, Zell Exteriors</p><hr/></div>',
    transcript:
      '<div><p>Các sản phẩm tấm lợp kim loại của Zell Exteriors mang lại nhiều ưu điểm vượt trội so với các vật liệu lợp mái truyền thống.</p><p><b>Lợi ích 1-Khả năng chống chọi với thời tiết:<br/></b>Công nghệ cung cấp khả năng bảo vệ tốt hơn khỏi mưa đá, gió và mưa</p><p><b>Lợi ích 2-Nhiều lựa chọn:<br/></b>Nhiều lựa chọn các loại bảng điều khiển, tùy chọn trang trí và màu sơn để lựa chọn</p><p><b>Quyền lợi 3-Đảm bảo sự hài lòng:<br/></b>Bảo hành 30 năm để tăng thêm sự an tâm</p><p><b>Lợi ích 4-Danh tiếng đã được thiết lập:<br/></b>Tấm lợp chất lượng từ một công ty đáng tin cậy</p><p>Đối với các câu hỏi về các sản phẩm cụ thể hoặc để yêu cầu báo giá từ nhân viên bán hàng của chúng tôi, hãy hoàn thành biểu mẫu liên hệ trực tuyến của chúng tôi. Tất cả các tấm lợp của chúng tôi đều được sản xuất tại một trong những cơ sở sản xuất trong khu vực của chúng tôi, cắt theo kích thước cần thiết cho mái của bạn và vận chuyển đến chi nhánh gần bạn. Các nhân viên lắp đặt chuyên nghiệp của chúng tôi sau đó sẽ lấy nó từ đó.</p><hr/><div>Tên: Gus Keenan</div><div>E-mail: <a class="__cf_email__" data-cfemail="f691d89d9393989798b6978382999381849f8293d8989382" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div>Điện thoại: 555-0188</div><div><br/></div><div>Bình luận:</div><div><br/></div><div>Tôi đã xem xét nhiều loại vật liệu lợp mái khác nhau, và nhiều lựa chọn sơn khác nhau khiến công ty của bạn trở thành lựa chọn hàng đầu của tôi. Tòa nhà lán của tôi có một màu tím kỳ lạ, và tôi muốn tìm một màu bổ sung cho nó. Nhưng tôi có một câu hỏi. Tôi muốn mái tôn mới được đặt trên mái tôn cũ mà tôi có. Điều này sẽ tiết kiệm tiền về thời gian, sức lao động và việc tiêu hủy. Bán có đề nghị gì về việc này? Tôi đã dành nhiều thời gian đọc các diễn đàn trực tuyến dành cho các nhà thầu chuyên nghiệp, và có nhiều ý kiến trái chiều về việc này.</div><hr/><div>Tới: <a class="__cf_email__" data-cfemail="3c5b12575959525d527c5d494853594b4e55485912525948" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div>Từ: <a class="__cf_email__" data-cfemail="127c617a776066685268777e7e776a6677607b7d60613c717d7f" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div>Ngày: 20 tháng 5</div><div>Chủ đề: Yêu cầu về lợp mái</div><div>Tệp đính kèm: Danh mục Zell Ngoại thất</div><div><br/></div><div>Kính gửi ông Keenan,</div><div><br/></div><div>Đại diện bán hàng sẽ liên hệ với bạn qua điện thoại trong vòng 48 giờ, nhưng trước tiên, vui lòng xem qua danh mục sản phẩm đính kèm. Dưới đây là bốn loại tấm lợp cơ bản mà chúng tôi cung cấp:</div><div>Tấm SLP Snap Lock Steel có tính năng khóa cho phép lắp đặt nhanh chóng.</div><div>Tấm nhôm XM Panel với khả năng chống ăn mòn vượt trội. Lý tưởng cho khí hậu ẩm ướt.</div><div>QR Rigid Tấm chi phí thấp có thể được lắp đặt trực tiếp trên mái nhà hiện có.</div><div>Tấm WT Loại thép thương mại bền nhất của chúng tôi. Chỉ có hai màu trắng và xám.</div><div><br/></div><div>Cảm ơn bạn,</div><div>Nicola Shertz. Trợ lý hành chính, ngoại thất Zell</div><hr/></div>',
